package com.comerzzia.bricodepot.pos.services.fidelizado;

import java.io.File;
import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;
import java.util.Date;

public class MainCaptacion {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String cadena = "";

		byte[] decoded = Base64.getDecoder().decode(cadena);
		FileOutputStream fop;
		try {
			File file = new File("C:\\Proyectos\\Proyectos\\Bricodepot\\Consentimientos\\consentimiento" + new Date().getTime() + ".pdf");
			fop = new FileOutputStream(file);

			fop.write(decoded);
			fop.flush();
			fop.close();
		}
		catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
	}

}
